import React from "react";

const animation = () => {
  let animate = () => {
    document
      .getElementById("IFrameId")
      .contentWindow.document.keydown(function () {
        alert("Key down!");
      });
  };

  return (
    <div className="ANOuterDiv">
      <iframe
        src="https://my.spline.design/buildingsunsetcopy-a0755fe79ab59dc655f24e1c6b5575b4/"
        frameborder="0"
        width="1000px"
        height="650px"
      ></iframe>
      <button onClick={animate}>Click</button>
    </div>
  );
};

export default animation;
